import './App.css';
import ProfilePicture from './ProfilePicture.svg';
import Navigation from './Navigation/Navigation';
import Name from './Name/Name';
import Stats from './Stats/Stats';

function App() {
  return (
    <div className="App">

      <Navigation/>

      <img className="ProfilePicture" src={ProfilePicture} />

      <Name>Jane Doe</Name>

      <Stats/>

    </div>
  );
}

export default App;
